/**
 * @brief This function set MEMC mode.
 * @param [in] emm 			Specify MEMC mode.
 * @retval TRUE 			indicates success
 * @retval FALSE			indicates fail.
*/
BOOL MEMC_LibSetMEMCMode(MEMC_MODE emm)
{
	_PQL_Command PQLCommand;
	#if CONFIG_MEMC_OSD_PARAM
	SLR_VIP_TABLE *gVip_Table = fwif_colo_get_AP_vip_table_gVIP_Table();
	#endif

	if(gstAppData.stMEMCData.enMemcMode != emm)
	{
		rtd_pr_memc_notice("[MEMC][MEMC_LibSetMEMCMode] mode=%d\n", emm);
		gstAppData.stMEMCData.enMemcMode = emm;

		PQLCommand.u3_memcMode = emm;
		PQL_Command(PQL_CMD_MEMC_MODE, &PQLCommand);

		if(emm == MEMC_SMOOTH) //tv001:HIGH		tv006:Smooth
		{
			#if CONFIG_MEMC_OSD_PARAM
			gstAppData.stMEMCData.uiDejudderLevel = gVip_Table->MEMC_PARAMS.JudderMotionTable[3];
			gstAppData.stMEMCData.uiDeblurLevel = gVip_Table->MEMC_PARAMS.BlurMotionTable[3];
			#else
			gstAppData.stMEMCData.uiDejudderLevel = 128;
			gstAppData.stMEMCData.uiDeblurLevel = 128;
			#endif
			gstAppData.stMEMCData.uiFallbackLevel = 80;
			rtd_printk(KERN_INFO, TAG_NAME_MEMC,"[%s] mode:HIGH, dejudder:%d, deblur:%d\n", __FUNCTION__, gstAppData.stMEMCData.uiDejudderLevel, gstAppData.stMEMCData.uiDeblurLevel);
		}
		else if(emm == MEMC_CLEAR) //tv001:MID		tv006:Natural
		{
			#if CONFIG_MEMC_OSD_PARAM
			gstAppData.stMEMCData.uiDejudderLevel = gVip_Table->MEMC_PARAMS.JudderMotionTable[2];
			gstAppData.stMEMCData.uiDeblurLevel = gVip_Table->MEMC_PARAMS.BlurMotionTable[2];
			#else
			gstAppData.stMEMCData.uiDejudderLevel = 94;
			gstAppData.stMEMCData.uiDeblurLevel = 128;
			#endif
			gstAppData.stMEMCData.uiFallbackLevel = 48;
			rtd_printk(KERN_INFO, TAG_NAME_MEMC,"[%s] mode:MID, dejudder:%d, deblur:%d\n", __FUNCTION__, gstAppData.stMEMCData.uiDejudderLevel, gstAppData.stMEMCData.uiDeblurLevel);
		}
		else if(emm == MEMC_NORMAL) //tv001:LOW		tv006:NULL
		{
			#if CONFIG_MEMC_OSD_PARAM
			gstAppData.stMEMCData.uiDejudderLevel = gVip_Table->MEMC_PARAMS.JudderMotionTable[1];
			gstAppData.stMEMCData.uiDeblurLevel = gVip_Table->MEMC_PARAMS.BlurMotionTable[1];
			#else
			gstAppData.stMEMCData.uiDejudderLevel = 16;
			gstAppData.stMEMCData.uiDeblurLevel = 128;
			#endif
			gstAppData.stMEMCData.uiFallbackLevel = 64;
			rtd_printk(KERN_INFO, TAG_NAME_MEMC,"[%s] mode:LOW, dejudder:%d, deblur:%d\n", __FUNCTION__, gstAppData.stMEMCData.uiDejudderLevel, gstAppData.stMEMCData.uiDeblurLevel);
		}
		else if(emm == MEMC_OFF)
		{
			#if CONFIG_MEMC_OSD_PARAM
			gstAppData.stMEMCData.uiDejudderLevel = gVip_Table->MEMC_PARAMS.JudderMotionTable[0];
			gstAppData.stMEMCData.uiDeblurLevel = gVip_Table->MEMC_PARAMS.BlurMotionTable[0];
			#else
			gstAppData.stMEMCData.uiDejudderLevel = 0;
			gstAppData.stMEMCData.uiDeblurLevel = 0;
			#endif
			gstAppData.stMEMCData.uiFallbackLevel = 0;
			rtd_printk(KERN_INFO, TAG_NAME_MEMC,"[%s] mode:OFF, dejudder:%d, deblur:%d\n", __FUNCTION__, gstAppData.stMEMCData.uiDejudderLevel, gstAppData.stMEMCData.uiDeblurLevel);
		}
		else if(emm == MEMC_MEDIUM)	//tv001:Null	tv006:Cinematic
		{
			#if CONFIG_MEMC_OSD_PARAM
			gstAppData.stMEMCData.uiDejudderLevel = gVip_Table->MEMC_PARAMS.JudderMotionTable[1];
			gstAppData.stMEMCData.uiDeblurLevel = gVip_Table->MEMC_PARAMS.BlurMotionTable[1];
			#else
			gstAppData.stMEMCData.uiDejudderLevel = 42;
			gstAppData.stMEMCData.uiDeblurLevel = 128;
			#endif
			gstAppData.stMEMCData.uiFallbackLevel = 80;
			rtd_printk(KERN_INFO, TAG_NAME_MEMC,"[%s] mode:Cinematic, dejudder:%d, deblur:%d\n", __FUNCTION__, gstAppData.stMEMCData.uiDejudderLevel, gstAppData.stMEMCData.uiDeblurLevel);
		}
		else if(emm == MEMC_USER)
		{
		}
		else
		{
			return FALSE;
		}

		if(emm != MEMC_USER)
		{
			Mid_MEMC_SetMEMCDejudderLevel((unsigned short)gstAppData.stMEMCData.uiDejudderLevel);
			Mid_MEMC_SetMEMCDeblurLevel((unsigned short)gstAppData.stMEMCData.uiDeblurLevel);
			Mid_MEMC_SetMEMCFBLevel((unsigned short)gstAppData.stMEMCData.uiFallbackLevel);
		}

	#if 1  // k4lp
		//rtd_pr_memc_notice("1.MEMC_LibSetMEMCMode=%d,pcmode=%d\n",emm,MEMC_LibGetMEMC_PCModeEnable() );
		if(emm == MEMC_OFF)
		{
			if(Get_DISPLAY_PANEL_TYPE() == P_VBY1_TO_HDMI_MEMC_FREERUN){
				Mid_Mode_SetMCBlend(RGB_IN_PC_FREERUN_OUT);
			}else{
				Mid_Mode_SetMCBlend(RGB_IN_PC_OUT);
			}
		}
		else
		{
			if(MEMC_LibGetMEMC_PCModeEnable() == TRUE){
				if(Get_DISPLAY_PANEL_TYPE() == P_VBY1_TO_HDMI_MEMC_FREERUN){
					Mid_Mode_SetMCBlend(RGB_IN_PC_FREERUN_OUT);
				}else{
					Mid_Mode_SetMCBlend(RGB_IN_PC_OUT);
				}	
			}else{
				if(Get_DISPLAY_PANEL_TYPE() == P_VBY1_TO_HDMI_MEMC_FREERUN){
					Mid_Mode_SetMCBlend(RGB_IN_VIDEO_FREERUN_OUT);
				}else{
					Mid_Mode_SetMCBlend(RGB_IN_VIDEO_OUT);
				}	
			}
		}

		Mid_MEMC_SetPullDownMode((INPUT_FRAMERATE)gstAppData.stModeData.enInputFrameRate, \
								(OUTPUT_FRAMERATE)gstAppData.stModeData.enOutputFrameRate, \
								(unsigned char)(gstAppData.stMEMCData.enMemcMode != MEMC_OFF && gstAppData.stMEMCData.enMemcMode != MEMC_MODE_MAX), \
								(unsigned char)gstAppData.bCinemaMode);
	#endif

		if(emm == MEMC_CLEAR || emm == MEMC_NORMAL || emm == MEMC_MEDIUM || emm == MEMC_USER)
			PQLCommand.u1_osd_force_mode = 1;
		else
			PQLCommand.u1_osd_force_mode = 0;
		PQL_Command(PQL_CMD_OSD_FORCE_MODE, &PQLCommand);

		return TRUE;
	}
	else
	{
		//rtd_pr_memc_notice("2.MEMC_LibSetMEMCMode=%d\n",emm);
		return FALSE;
	}
}

