unsigned int sram_ipme1, sram_lbme, sram_lbme2, sram_me1_vbuf, sram_me2_vbuf, sram_logo, sram_me, sram_dehalo;
unsigned int me1, me2, in_isr, out_isr, dehalo, candn;
BOOL MEMC_LibPowerSaveOn(VOID)
{

	unsigned int powerSaving_en = 0;
	ReadRegister(SOFTWARE_SOFTWARE_00_reg, 26, 26, &powerSaving_en);

	if(powerSaving_en)
	{
		const _PQLCONTEXT *s_pContext = GetPQLContext();
		_PQL_Command PQLCommand;

		if(s_pContext->_output_filmDetectctrl.u8_cur_cadence_Id[_FILM_ALL]!=_CAD_VIDEO){
			return 1;
		}

		WriteRegister(HARDWARE_HARDWARE_63_reg, 29, 31, 0x0);

		{// save current status ----------------------------------------------------

			//SRAM LS Setting
			ReadRegister(KME_IPME1_KME_IPME1_00_reg, 25, 26, &sram_ipme1);
			ReadRegister(KME_LBME_TOP_KME_LBME_TOP_04_reg, 22, 23, &sram_lbme);
//			ReadRegister(FRC_TOP__KME_LBME_TOP__kme2_lbme_sram_ls_en_ADDR, 20, 21, &sram_lbme2);
			ReadRegister(KME_VBUF_TOP_KME_VBUF_TOP_70_reg, 22, 23, &sram_me1_vbuf);
			ReadRegister(KME_ME2_VBUF_TOP_KME_ME2_VBUF_TOP_18_reg, 17, 18, &sram_me2_vbuf);
			ReadRegister(KME_LOGO2_KME_LOGO2_34_reg, 22, 23, &sram_logo);
			ReadRegister(KME_DM_TOP0_KME_SOURCE_MODE_reg, 10, 11, &sram_me);
			ReadRegister(KME_DEHALO_KME_DEHALO_10_reg, 25, 25, &sram_dehalo);

			//set me1/me2 vbuf state machine don't work, reduce cand num
			ReadRegister(KME_VBUF_TOP_KME_VBUF_TOP_10_reg, 0, 15, &me1);
			ReadRegister(KME_ME2_VBUF_TOP_KME_ME2_VBUF_TOP_00_reg, 8, 8, &me2);

			//disable dehalo
			ReadRegister(KME_DEHALO_KME_DEHALO_10_reg, 0, 0, &dehalo);

			//reduce cand num
			ReadRegister(KME_VBUF_TOP_KME_VBUF_TOP_14_reg, 0, 14, &candn);

			//disable memc isr en
			//ReadRegister(KMC_TOP_kmc_top_18_reg, 24, 27, &in_isr);
			ReadRegister(KPOST_TOP_KPOST_TOP_08_reg, 5, 8, &out_isr);
		}

		{// do power save ----------------------------------------------------

			//SRAM LS Setting
			WriteRegister(KME_IPME1_KME_IPME1_00_reg, 25, 26, 0x2);
			WriteRegister(KME_LBME_TOP_KME_LBME_TOP_04_reg, 22, 23, 0x2);
//			WriteRegister(FRC_TOP__KME_LBME_TOP__kme2_lbme_sram_ls_en_ADDR, 20, 21, 0x2);
			WriteRegister(KME_VBUF_TOP_KME_VBUF_TOP_70_reg, 22, 23, 0x2);
			WriteRegister(KME_ME2_VBUF_TOP_KME_ME2_VBUF_TOP_18_reg, 17, 18, 0x2);
			WriteRegister(KME_LOGO2_KME_LOGO2_34_reg, 22, 23, 0x2);
			WriteRegister(KME_DM_TOP0_KME_SOURCE_MODE_reg, 10, 11, 0x2);
			WriteRegister(KME_DEHALO_KME_DEHALO_10_reg, 25, 25, 0x1);

			//set me1/me2 vbuf state machine don't work, reduce cand num
			WriteRegister(KME_VBUF_TOP_KME_VBUF_TOP_10_reg, 0, 15, 0x0);
			WriteRegister(KME_ME2_VBUF_TOP_KME_ME2_VBUF_TOP_00_reg, 8, 8, 0x0);

			//disable dehalo
			WriteRegister(KME_DEHALO_KME_DEHALO_10_reg, 0, 0, 0x0);//to here ng

			//reduce cand num
			WriteRegister(KME_VBUF_TOP_KME_VBUF_TOP_14_reg, 0, 14, 0x0);

			//disable memc isr en
			//WriteRegister(KMC_TOP_kmc_top_18_reg, 24, 27, 0x0);
			WriteRegister(KPOST_TOP_KPOST_TOP_08_reg, 5, 8, 0x0);
		}

		PQLCommand.u1_powerSaving = 1;
		PQL_Command(PQL_CMD_POWERSAVING, &PQLCommand);

		WriteRegister(HARDWARE_HARDWARE_63_reg, 29, 31, 0x7);

		return 0;
	}
	else
	{
		return 1;
	}
}

BOOL MEMC_LibPowerSaveOff(VOID)
{


	unsigned int powerSaving_en = 0;
	ReadRegister(SOFTWARE_SOFTWARE_00_reg, 26, 26, &powerSaving_en);

	if(powerSaving_en)
	{
		const _PQLCONTEXT *s_pContext = GetPQLContext();
		_PQL_Command PQLCommand;

		if(s_pContext->_output_filmDetectctrl.u8_cur_cadence_Id[_FILM_ALL]!=_CAD_VIDEO){
			return 1;
		}

		WriteRegister(HARDWARE_HARDWARE_63_reg, 29, 31, 0x0);

		{// disable power save ----------------------------------------------------

			//SRAM LS Setting
			WriteRegister(KME_IPME1_KME_IPME1_00_reg, 25, 26, sram_ipme1);
			WriteRegister(KME_LBME_TOP_KME_LBME_TOP_04_reg, 22, 23, sram_lbme);
//			WriteRegister(FRC_TOP__KME_ME2_LBME_TOP__reg_me2_lbme_sram_ls_en_ADDR, 20, 21, sram_lbme2);
			WriteRegister(KME_VBUF_TOP_KME_VBUF_TOP_70_reg, 22, 23, sram_me1_vbuf);
			WriteRegister(KME_ME2_VBUF_TOP_KME_ME2_VBUF_TOP_18_reg, 17, 18, sram_me2_vbuf);
			WriteRegister(KME_LOGO2_KME_LOGO2_34_reg, 22, 23, sram_logo);
			WriteRegister(KME_DM_TOP0_KME_SOURCE_MODE_reg, 10, 11, sram_me);
			WriteRegister(KME_DEHALO_KME_DEHALO_10_reg, 25, 25, sram_dehalo);

			//set me1/me2 vbuf state machine don't work, reduce cand num
			WriteRegister(KME_VBUF_TOP_KME_VBUF_TOP_10_reg, 0, 15, me1);
			WriteRegister(KME_ME2_VBUF_TOP_KME_ME2_VBUF_TOP_00_reg, 8, 8, me2);

			//disable dehalo
			WriteRegister(KME_DEHALO_KME_DEHALO_10_reg, 0, 0, dehalo);

			//reduce cand num
			WriteRegister(KME_VBUF_TOP_KME_VBUF_TOP_14_reg, 0, 14, candn);

			//disable memc isr en
			//WriteRegister(KMC_TOP_kmc_top_18_reg, 24, 27, in_isr);
			WriteRegister(KPOST_TOP_KPOST_TOP_08_reg, 5, 8, out_isr);
		}

		PQLCommand.u1_powerSaving = 0;
		PQL_Command(PQL_CMD_POWERSAVING, &PQLCommand);

		WriteRegister(HARDWARE_HARDWARE_63_reg, 29, 31, 0x7);

		return 0;
	}
	else
	{
		return 1;
	}
}

VOID MEMC_Lib_MEDMA_Control(unsigned char ME_DMA, unsigned char MEinfoKeep, unsigned char bMute, unsigned char bforce)
{
	static unsigned char ME_DMA_pre = 255;

	if((ME_DMA_pre != ME_DMA) || bforce){
		
		if(ME_DMA)
		{
			rtd_pr_memc_lib_debug("[MEMC_LibDisableMEDMA_01][%x, %x, %x, %x, %x, %x]\n\r", rtd_inl(MC_DMA_MC_LF_DMA_WR_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_DMA_WR_Ctrl_reg), rtd_inl(MC_DMA_MC_LF_I_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_I_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_LF_P_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_P_DMA_RD_Ctrl_reg));
			Mid_Mode_EnableMEDMA();
			rtd_pr_memc_lib_debug("[MEMC_LibDisableMEDMA_02][%x, %x, %x, %x, %x, %x]\n\r", rtd_inl(MC_DMA_MC_LF_DMA_WR_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_DMA_WR_Ctrl_reg), rtd_inl(MC_DMA_MC_LF_I_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_I_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_LF_P_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_P_DMA_RD_Ctrl_reg));
		}
		else
		{	
			rtd_pr_memc_lib_debug("[MEMC_LibDisableMEDMA_01][%x, %x, %x, %x, %x, %x]\n\r", rtd_inl(MC_DMA_MC_LF_DMA_WR_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_DMA_WR_Ctrl_reg), rtd_inl(MC_DMA_MC_LF_I_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_I_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_LF_P_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_P_DMA_RD_Ctrl_reg));
			Mid_Mode_DisableMEDMA(MEinfoKeep);	
			rtd_pr_memc_lib_debug("[MEMC_LibDisableMEDMA_02][%x, %x, %x, %x, %x, %x]\n\r", rtd_inl(MC_DMA_MC_LF_DMA_WR_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_DMA_WR_Ctrl_reg), rtd_inl(MC_DMA_MC_LF_I_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_I_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_LF_P_DMA_RD_Ctrl_reg), rtd_inl(MC_DMA_MC_HF_P_DMA_RD_Ctrl_reg));
		}
		ME_DMA_pre = ME_DMA;
	}
}

VOID MEMC_Lib_MCDMA_Control(unsigned char  MC_DMA, unsigned char bMute, unsigned char bforce)
{
	static unsigned char MC_DMA_pre = 255;

	if( (MC_DMA_pre != MC_DMA) || bforce){
		
		if(MC_DMA)
		{
			Mid_Mode_EnableMCDMA();
		}
		else
		{
			Mid_Mode_DisableMCDMA();
		}
		MC_DMA_pre = MC_DMA;
	}		
}

