VOID MEMC_Lib_MC_IndexCheck(VOID)
{
 	const _PQLCONTEXT *s_pContext = GetPQLContext();
	unsigned int mc_write = 0, mc_read_i = 0, mc_read_p = 0;
	unsigned char pulldown_mode = 0;
	FRC_CADENCE_ID u8_cadence_id = 0;
	unsigned int buffer_size = 0, bBGEn = 0, MEMC_BGEn = 0, MEMC_MuxEn = 0, MEMC_Mux_BGEn;;
//	#if CONFIG_MC_8_BUFFER
//	unsigned char buffer_size = 8;
//	#else
//	unsigned char buffer_size = 6;
//	#endif

//	if(Get_DISPLAY_PANEL_TYPE()== P_VBY1_TO_HDMI_MEMC_FREERUN){
//		buffer_size = 4;
//	}

	ReadRegister(KPHASE_kphase_90_reg, 0, 2, &mc_write);
	ReadRegister(KPHASE_kphase_90_reg, 4, 6, &mc_read_i);
	ReadRegister(KPHASE_kphase_90_reg, 8, 10, &mc_read_p);
	ReadRegister(KPHASE_kphase_10_reg, 12, 15, &buffer_size);
	pulldown_mode = s_pContext->_external_data.u8_pulldown_mode;
	u8_cadence_id = s_pContext->_output_filmDetectctrl.u8_cur_cadence_out[_FILM_ALL];
	bBGEn = (rtd_inl(PPOVERLAY_Main_Display_Control_RSV_reg)>>1) & 0x1;
	MEMC_Mux_BGEn = PPOVERLAY_MEMC_MUX_CTRL_get_memc_out_bg_en(rtd_inl(PPOVERLAY_MEMC_MUX_CTRL_reg));
	ReadRegister(KPOST_TOP_KPOST_TOP_60_reg, 30, 30, &MEMC_BGEn);
	MEMC_MuxEn = PPOVERLAY_MEMC_MUX_CTRL_get_memc_outmux_sel(rtd_inl(PPOVERLAY_MEMC_MUX_CTRL_reg));

	// phase table protect
	if(pulldown_mode == _PQL_IN24HZ_TRUMOTOFF_CINEMAOFF ||
		((u8_cadence_id == _CAD_32 || u8_cadence_id == _CAD_2224) && pulldown_mode == _PQL_IN60HZ_TRUMOTOFF_CINEMAOFF)){

	}
	else{
		if(mc_write > (buffer_size-1) || mc_read_i > (buffer_size-1) || mc_read_p > (buffer_size-1)){
			rtd_pr_memc_notice("[%s][Warning!!!MC index is out of range][Re-gen phase table!!!][%d,%d,%d,%d][BG,%d,%d,%d,][MEMC_mux,%d,]\n\r", __FUNCTION__, 
				mc_write, mc_read_i, mc_read_p, buffer_size, bBGEn, MEMC_BGEn, MEMC_Mux_BGEn, MEMC_MuxEn);
			WriteRegister(SOFTWARE_SOFTWARE_08_reg, 27, 27, 1);
			rtd_outl(0xb806016c,0x23792379);
		}
	}
}

