VOID MEMC_LibResetFlow(VOID)
{
#ifdef CONFIG_MEMC_NOTSUPPORT // for code size reduce, when MEMC_BYPASS
			return;
#else

	unsigned int ResetFlow_en = 0;
//	unsigned int ME_clock_state = 0;
//	unsigned int MEMC_clock_state = 0;
	static unsigned char reset_flow_cnt = 0;

	if(get_MEMC_bypass_status_refer_platform_model() == TRUE) {
		return;
	}

	ReadRegister(SOFTWARE1_SOFTWARE1_00_reg, 0, 31, &ResetFlow_en);
	ResetFlow_en = (ResetFlow_en>>3) & 0x1;
//	ME_clock_state = (rtd_inl(SYS_REG_SYS_CLKEN3_reg)>>30)&0x1;
//	MEMC_clock_state = (rtd_inl(SYS_REG_SYS_CLKEN3_reg)>>31)&0x1;

	if(ResetFlow_en == 1){
		reset_flow_cnt = 5;

		//disable Power Saving
		WriteRegister(SOFTWARE1_SOFTWARE1_00_reg, 0, 0, 0x0);
//		WriteRegister(SOFTWARE1_SOFTWARE1_63_reg, 29, 29, 0x1);

		WriteRegister(SOFTWARE1_SOFTWARE1_00_reg, 3, 3, 0x0);
		rtd_pr_memc_notice("[jerry_reset_flow][AAA]\n\r");
	}

	if(reset_flow_cnt == 2){
		//turn on DMA & clock
/*
		if(MEMC_clock_state == 0){
			rtd_pr_memc_notice("[jerry_reset_flow][BBB]\n\r");
			Scaler_MEMC_Bypass_CLK_OnOff(1);
			Scaler_MEMC_Set_BypassToEnable_Flag(1);
		}
		else if(ME_clock_state == 0){
			rtd_pr_memc_notice("[jerry_reset_flow][CCC]\n\r");
			Scaler_MEMC_HDMI_ME_CLK_OnOff(1);
			MEMC_Lib_HDMI_set_memc_bypass_to_enable_flag(1);
			//
			rtd_outl(0xb809f004, tmp_val);
			rtd_outl(CRTC1_CRTC1_14_reg, tmp_crtc1_frc_hact);
			rtd_outl(CRTC1_CRTC1_44_reg, tmp_crtc1_mc_vact);
		}
*/
		//reload MEMC setting
		Scaler_MEMC_Handler();

		//disable mute
		MEMC_LibBlueScreen(0);

		//disable Power Saving
		WriteRegister(SOFTWARE1_SOFTWARE1_00_reg, 0, 0, 0x0);
//		WriteRegister(SOFTWARE1_SOFTWARE1_63_reg, 29, 29, 0x1);

		//WriteRegister(HARDWARE_HARDWARE_63_reg, 28, 28, 0x1);
	}

	if(reset_flow_cnt > 0){
		reset_flow_cnt--;
	}
#endif	
}

