VOID MEMC_Lib_SetPhaseTableAutoMode(unsigned char u1_enable)
{
	if(u1_enable){
		kphase_kphase_80_RBUS kphase_kphase_80_reg;
		kphase_kphase_80_reg.regValue = rtd_inl(KPHASE_kphase_80_reg);
		kphase_kphase_80_reg.frc_auto_mode_en = 1;
		kphase_kphase_80_reg.frc_auto_input_fast = 0;
		kphase_kphase_80_reg.frc_auto_buf_num = 4;
		kphase_kphase_80_reg.frc_auto_buf_offset = 1;
		rtd_outl(KPHASE_kphase_80_reg, kphase_kphase_80_reg.regValue);
	}else{
		kphase_kphase_80_RBUS kphase_kphase_80_reg;
		kphase_kphase_80_reg.regValue = rtd_inl(KPHASE_kphase_80_reg);
		kphase_kphase_80_reg.frc_auto_mode_en = 0;
		rtd_outl(KPHASE_kphase_80_reg, kphase_kphase_80_reg.regValue);
	}
}

