	g_frm_cnt = frm_ctrl_cnt;
	me_write_pre = me_write;
	me1_read_i_pre = me1_read_i;
	me1_read_p_pre = me1_read_p;
	me2_read_i_pre = me2_read_i;
	me2_read_p_pre = me2_read_p;
	mc_write_pre = mc_write;
	mc_read_i_pre = mc_read_i;
