{
	MEMC_Freeze_flag = u1_enable;
}
unsigned char MEMC_Lib_get_memc_Freeze_flag(VOID)
{
	return MEMC_Freeze_flag;
}
void MEMC_Lib_Freeze(unsigned char enable)
{
#ifdef CONFIG_MEMC_NOTSUPPORT // for code size reduce, when MEMC_BYPASS
			return;
#else

 	const _PQLCONTEXT *s_pContext = GetPQLContext();
	unsigned long flags;
	unsigned int mc_write = 0, mc_read_i = 0, mc_read_p = 0;
	unsigned int mc_read_i_tmp = 0, mc_read_p_tmp = 0, bsize = 0;
	static unsigned char Freeze_status = 0;
	unsigned char pulldown_mode = 0;
	FRC_CADENCE_ID u8_cadence_id = 0;
	unsigned char uzu_bg = 0, memc_bg = 0, memc_mux_bg = 0;

	if(get_MEMC_bypass_status_refer_platform_model() == TRUE)
		return;	

	ReadRegister(KPHASE_kphase_90_reg, 0, 2, &mc_write);
	ReadRegister(KPHASE_kphase_90_reg, 4, 6, &mc_read_i);
	ReadRegister(KPHASE_kphase_90_reg, 8, 10, &mc_read_p);
	ReadRegister(KPHASE_kphase_10_reg, 12, 15, &bsize);
	pulldown_mode = s_pContext->_external_data.u8_pulldown_mode;
	u8_cadence_id = s_pContext->_output_filmDetectctrl.u8_cur_cadence_out[_FILM_ALL];
	uzu_bg = (rtd_inl(PPOVERLAY_Main_Display_Control_RSV_reg)>>1)&0x1;
	memc_bg = (rtd_inl(KPOST_TOP_KPOST_TOP_60_reg)>>30)&0x1;
	memc_mux_bg = (rtd_inl(PPOVERLAY_MEMC_MUX_CTRL_reg)>>12)&0x1;
	rtd_pr_memc_notice("[%s][pulldown_mode,%d,][u8_cadence_id,%d,][MC_idx,%d,%d,%d,][BG(%d/%d/%d)][,%d,](%d)->(%d)\n\r", 
		__FUNCTION__, pulldown_mode, u8_cadence_id, mc_write, mc_read_i, mc_read_p, uzu_bg, memc_bg, memc_mux_bg, Scaler_DispGetInputInfoByDisp(0/*SLR_MAIN_DISPLAY*/, 41/*SLR_INPUT_STATE*/), Freeze_status, enable);

	if((enable == 1) && (enable != Freeze_status) && (uzu_bg || memc_bg || memc_mux_bg)){
		rtd_pr_memc_notice("[%s][BG is on (%d/%d/%d) !! Don't freeze !!]\n\r", __FUNCTION__, uzu_bg, memc_bg, memc_mux_bg);
		enable = 0;
	}

#if 1
	if(enable != Freeze_status)
	{
	rtd_pr_memc_emerg("\r#### will test func:%s line:%d enable:%d Freeze_status:%d ####\r\n",__FUNCTION__,__LINE__, enable, Freeze_status);
		spin_lock_irqsave(&memc_freeze_ctrl_spinlock, flags);
		if(enable == 1){
			if(Freeze_status == 0){
				WriteRegister(MC_DMA_MC_LF_DMA_WR_Ctrl_reg, 0, 0, 0);
				WriteRegister(MC_DMA_MC_HF_DMA_WR_Ctrl_reg, 0, 0, 0);

				WriteRegister(KPHASE_kphase_04_reg, 11, 11, 1);
				WriteRegister(KPHASE_kphase_04_reg, 8, 10, mc_write);

				WriteRegister(KPHASE_kphase_00_reg, 3, 3, 1);
				#if 1
				if(mc_read_i == mc_write || mc_read_p == mc_write){
					mc_read_i_tmp = (mc_write+1)%bsize;
					mc_read_p_tmp = (mc_write+2)%bsize;
				}
				else{
					mc_read_i_tmp = mc_read_i;
					mc_read_p_tmp = mc_read_p;
				}
				#else
				mc_read_i_tmp = (mc_read_i+1)%bsize;
				mc_read_p_tmp = (mc_read_p+1)%bsize;
				#endif
				WriteRegister(KPHASE_kphase_00_reg, 0, 2, mc_read_i_tmp);
				WriteRegister(KPHASE_kphase_00_reg, 4, 6, mc_read_p_tmp);

				// set Repeat mode
				if(pulldown_mode == _PQL_IN24HZ_TRUMOTOFF_CINEMAOFF ||
					((u8_cadence_id == _CAD_32 || u8_cadence_id == _CAD_2224) && pulldown_mode == _PQL_IN60HZ_TRUMOTOFF_CINEMAOFF)){
					MEMC_LibSetMCBlend(2);
				}
				else{
					MEMC_LibSetMCBlend(1);
				}
				MEMC_Lib_set_memc_Freeze_flag(1);
			}
			Freeze_status = 1;
		}
		else{
			if(Freeze_status == 1){

				WriteRegister(MC_DMA_MC_LF_DMA_WR_Ctrl_reg, 0, 0, 1);
				WriteRegister(MC_DMA_MC_HF_DMA_WR_Ctrl_reg, 0, 0, 1);

				WriteRegister(KPHASE_kphase_04_reg, 11, 11, 0);
				WriteRegister(KPHASE_kphase_00_reg, 3, 3, 0x0);

				if((MEMC_LibGetMEMC_PCModeEnable()) || (u8_MEMCMode == 0) || (u8_MEMCMode == 4 && dejudder == 0) || (MEMC_Lib_get_memc_PowerSaving_Mode() > 0)){
					if(pulldown_mode == _PQL_IN24HZ_TRUMOTOFF_CINEMAOFF ||
						((u8_cadence_id == _CAD_32 || u8_cadence_id == _CAD_2224) && pulldown_mode == _PQL_IN60HZ_TRUMOTOFF_CINEMAOFF)){
						MEMC_LibSetMCBlend(2);
					}
					else{
						MEMC_LibSetMCBlend(1);
					}
				}
				else{
					MEMC_LibSetMCBlend(0);
				}
				MEMC_Lib_set_memc_Freeze_flag(0);
			}
			Freeze_status = 0;
		}
		spin_unlock_irqrestore(&memc_freeze_ctrl_spinlock, flags);
	}
#endif
#endif
}

