unsigned char MEMC_Lib_GetInfo(unsigned char infoSel, unsigned char x1, unsigned char x2, unsigned char y1, unsigned char y2)
{
	_PQLCONTEXT *s_pContext = GetPQLContext_m();
	unsigned char Ret = 255;
	int i, j;
	unsigned short GMV_1st_vx = abs(s_pContext->_output_read_comreg.s11_me_GMV_1st_vx_rb);
	unsigned short GMV_1st_vy = abs(s_pContext->_output_read_comreg.s10_me_GMV_1st_vy_rb);
	unsigned short GMV_2nd_vx = abs(s_pContext->_output_read_comreg.s11_me_GMV_2nd_vx_rb);
	unsigned short GMV_2nd_vy = abs(s_pContext->_output_read_comreg.s10_me_GMV_2nd_vy_rb);


	unsigned short rMV_1st_max = 0;
	unsigned short rMV_1st_tmp = 0;
	unsigned short rMV_2nd_max = 0;
	unsigned short rMV_2nd_tmp = 0;

	switch(infoSel)
	{
		default:
		case 0: // gmv1
			Ret = MAX(GMV_1st_vx, GMV_1st_vy);
			break;

		case 1: // gmv2
			Ret = MAX(GMV_2nd_vx, GMV_2nd_vy);
			break;

		case 2: // rmv1
			for(j=y1; j<=y2; j++)
			{
				for(i=x1; i<=x2; i++)
				{
					rMV_1st_tmp = MAX(abs(s_pContext->_output_read_comreg.s11_me_rMV_1st_vx_rb[j*8+i]), abs(s_pContext->_output_read_comreg.s10_me_rMV_1st_vy_rb[j*8+i]));

					if(rMV_1st_max < rMV_1st_tmp)
						rMV_1st_max = rMV_1st_tmp;
				}
			}
			Ret = rMV_1st_max;
			break;

		case 3: // rmv2
			for(j=y1; j<=y2; j++)
			{
				for(i=x1; i<=x2; i++)
				{
					rMV_2nd_tmp = MAX(abs(s_pContext->_output_read_comreg.s11_me_rMV_2nd_vx_rb[j*8+i]), abs(s_pContext->_output_read_comreg.s10_me_rMV_2nd_vy_rb[j*8+i]));

					if(rMV_2nd_max < rMV_2nd_tmp)
						rMV_2nd_max = rMV_2nd_tmp;
				}
			}
			Ret = rMV_2nd_max;
			break;

	}

	if(Ret > 255)
		Ret = 255;

	return Ret;
}

unsigned int MEMC_Lib_GetInfoForSLD(unsigned char infoSel)
{
	_PQLCONTEXT *s_pContext = GetPQLContext_m();

	unsigned int u32RBVal = 0;

	// For data valid
	unsigned char u1_ME_Clk_Enable = 0;
	unsigned char u1_MEMC_Mux_Sel  = 0;
	unsigned char u1_LogoEnable = 0;
	unsigned char u1_isMute = 0;

	unsigned int Ret = 0;

	switch(infoSel)
	{
		case 0: // pixel logo clear signal
			Ret = s_pContext->_output_FRC_LgDet.u32_blklogo_clr_idx | s_pContext->_output_FRC_LgDet.u32_logo_hsty_clr_lgclr_idx;
			break;
		case 1: // me1 scene change
			Ret = s_pContext->_output_read_comreg.u1_sc_status_rb;
			break;
		case 2: // logo scene change
			Ret = s_pContext->_output_read_comreg.u1_sc_status_logo_rb;
			break;
		case 3: // dehalo scene change
			Ret = s_pContext->_output_read_comreg.u1_sc_status_dh_rb;
			break;
		case 4: // frame motion
			Ret = s_pContext->_output_me_sceneAnalysis.u32_aFrmMot_4Max;
			break;
		case 5: // about center frame diff
			Ret = s_pContext->_output_me_sceneAnalysis.u32_cFrmMot_4Max;
			break;
		case 6: // pixel logo clear signal for sld
			Ret = s_pContext->_output_FRC_LgDet.u32_PxlRgClrSig;
			break;
		case 7: // output data valid or not
			// me clock
			u1_ME_Clk_Enable = (rtd_inl(SYS_REG_SYS_CLKEN3_reg)>>30)&0x1;

			// memc mux output
			u1_MEMC_Mux_Sel  = (rtd_inl(PPOVERLAY_MEMC_MUX_CTRL_reg)>>13)&0x1;

			// check mute or not
			u1_isMute = 0;
			ReadRegister(KPOST_TOP_KPOST_TOP_60_reg, 30, 30, &u32RBVal);
			u1_isMute = u1_isMute || u32RBVal;
			u1_isMute = u1_isMute || (rtd_inl(PPOVERLAY_Main_Display_Control_RSV_reg)>>1)&0x1;

			// check client
			u1_LogoEnable = 1;
			ReadRegister(KME_DM_TOP1_KME_DM_TOP1_14_reg, 20, 20, &u32RBVal);
			u1_LogoEnable = u1_LogoEnable && u32RBVal;
			ReadRegister(KME_DM_TOP1_KME_DM_TOP1_1C_reg , 20 , 20 , &u32RBVal);
			u1_LogoEnable = u1_LogoEnable && u32RBVal;
			ReadRegister(KME_DM_TOP1_KME_DM_TOP1_38_reg, 20, 20, &u32RBVal);
			u1_LogoEnable = u1_LogoEnable && u32RBVal;
			ReadRegister(KME_DM_TOP1_KME_DM_TOP1_40_reg , 20 , 20 , &u32RBVal);
			u1_LogoEnable = u1_LogoEnable && u32RBVal;
			ReadRegister(KME_DM_TOP1_KME_DM_TOP1_5C_reg, 20, 20, &u32RBVal);
			u1_LogoEnable = u1_LogoEnable && u32RBVal;
			ReadRegister(KME_DM_TOP1_KME_DM_TOP1_64_reg , 20 , 20 , &u32RBVal);
			u1_LogoEnable = u1_LogoEnable && u32RBVal;
			ReadRegister(KME_DM_TOP1_KME_DM_TOP1_80_reg, 20, 20, &u32RBVal);
			u1_LogoEnable = u1_LogoEnable && u32RBVal;
			ReadRegister(KME_DM_TOP1_KME_DM_TOP1_88_reg , 20 , 20 , &u32RBVal);
			u1_LogoEnable = u1_LogoEnable && u32RBVal;

			if(u1_ME_Clk_Enable == 0 || u1_MEMC_Mux_Sel == 0 || u1_LogoEnable == 0 || u1_isMute == 1)
				Ret = 0;
			else
				Ret = 1;

			break;
		default:
			Ret = 0;
			break;
	}

	return Ret;
}

